import React from "react";
import Home from "./Home";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <div className="app_div">
        <Routes>
          <Route path="/" Component={<Home />} />
        </Routes>
      </div>
    </>
  );
}

export default App;
